import React from 'react';
import generate from '@babel/generator';

const Generate = ({save}) => {

    const generate = (e) => {
        e.preventDefault();
        save(true);
    }
    return(
        <div className="generate">
            <input type="submit" value="Generate quote" onClick={generate}/>
        </div>
    )
}

export default Generate;
